                                                        <p class="font_8" style="font-size:12px; line-height:normal;"><span style="letter-spacing:normal;"><span style="font-size:12px;"><span style="font-family:poppins-extralight,poppins,sans-serif;">Diseadora
                                                                        de maquillaje profesional certificada,
                                                                        empresaria, conductora, conferencista y artista
                                                                        internacional con casi 30 aos de experiencia.
                                                                        &nbsp;</span></span></span></p>

                                                        <p class="font_8" style="font-size:12px; line-height:normal;"><span style="letter-spacing:normal;"><span style="font-size:12px;"><span style="font-family:poppins-extralight,poppins,sans-serif;">Ha
                                                                        desarrollado su propia tcnica de maquillaje a
                                                                        travs de cursos y actualizaciones constantes en
                                                                        Mxico, Estados Unidos, Argentina, Hong Kong y
                                                                        Francia. &nbsp;</span></span></span></p>

                                                        <p class="font_8" style="font-size:12px; line-height:normal;"><span style="letter-spacing:normal;"><span style="font-size:12px;"><span style="font-family:poppins-extralight,poppins,sans-serif;">Ha
                                                                        participado en congresos de mujeres, ha
                                                                        impartido cursos y seminarios de imagen y
                                                                        comunicacin as como talleres de ventas en
                                                                        diferentes empresas y universidades como: Grupo
                                                                        Alsea, Mexicana de Aviacin, Tecnolgico de
                                                                        Monterrey, Universidad La Salle y Universidad
                                                                        Isec.&nbsp;</span></span></span></p>

                                                        <p class="font_8" style="font-size:12px; line-height:normal;"><span style="letter-spacing:normal;"><span style="font-size:12px;"><span style="font-family:poppins-extralight,poppins,sans-serif;">Ha
                                                                        participado en programas para cadenas de
                                                                        televisin y radiodifusoras tales &nbsp;como
                                                                        Fox, Discovery Home and Health, TV Azteca, ,
                                                                        Televisin Mexiquense, Cadena 3, HBO, Utilisima,
                                                                        Telestai, Televisa, Radio Formula y
                                                                        MVS.</span></span></span></p>

                                                        <p class="font_8" style="font-size:12px; line-height:normal;"><span style="letter-spacing:normal;"><span style="font-size:12px;"><span style="font-family:poppins-extralight,poppins,sans-serif;">Fue
                                                                        Directora de Imagen Nacional del certamen de
                                                                        belleza Miss Mxico en 2016 y 2017 y es lder en
                                                                        el arreglo de novias en la Ciudad de Mxico,
                                                                        formando un equipo de profesionales para
                                                                        desarrollar esta bellsima
                                                                        labor.&nbsp;</span></span></span></p>

                                                        <p class="font_8" style="font-size:12px; line-height:normal;"><span style="letter-spacing:normal;"><span style="font-size:12px;"><span style="font-family:poppins-extralight,poppins,sans-serif;">Fundadora
                                                                        y directora general de su propia empresa y marca
                                                                        de maquillaje. Cuenta con un Instituto donde se
                                                                        forman maquilladores y peinadores profesionales
                                                                        del ms alto nivel, una tienda multimarcas de
                                                                        maquillaje con la ms cuidadosa seleccin de
                                                                        productos profesionales y adems cuenta con un
                                                                        estudio de belleza que ofrece servicio a miles
                                                                        de mujeres cada ao.</span></span></span></p>

                                                        <p class="font_8" style="font-size:12px; line-height:normal;"><span style="letter-spacing:normal;"><span style="font-size:12px;"><span style="font-family:poppins-extralight,poppins,sans-serif;">Posee
                                                                        un alto concepto de la calidad en el servicio y
                                                                        ha especializado su marca en resaltar la belleza
                                                                        y el valor de las mujeres en la
                                                                        sociedad.&nbsp;</span></span></span></p>

                                                        <p class="font_8" style="font-size:12px; line-height:normal;"><span style="letter-spacing:normal;"><span style="font-size:12px;"><span style="font-family:poppins-extralight,poppins,sans-serif;"><span class="wixGuard"></span></span></span></span>
                                                        </p>
